const e=JSON.parse(`{"key":"v-26636eef","path":"/projects/help-rich-richer.html","title":"Help Rich Info Get Richer: Enriching a semi-structured dataset using a Semantic Web approach","lang":"en-US","frontmatter":{"tag":["Semantic Web","Linked Data"],"category":"Computer Science","description":"Help Rich Info Get Richer: Enriching a semi-structured dataset using a Semantic Web approach This project presented a data integration approach to enrich a semi-structured dataset called ProVerB. ProVerB is a project to explain and classify program verification tools. It offers some URLs linking to external supporting resources for each tool. However, these URLs contain little information, and a user needs to explore them manually to find what they need. Therefore, a data integration project is conducted to supply these tools with additional information by fetching original data from these URLs. The solution is implemented using a Semantic Web approach to preserve the structure of ProVerB and explore possible relationships among incoming data. The new data and their potential relationships are inserted back into ProVerB to help this dataset become richer.","head":[["meta",{"property":"og:url","content":"https://blog.yujieliu.com/projects/help-rich-richer.html"}],["meta",{"property":"og:site_name","content":"Yujie's blog"}],["meta",{"property":"og:title","content":"Help Rich Info Get Richer: Enriching a semi-structured dataset using a Semantic Web approach"}],["meta",{"property":"og:description","content":"Help Rich Info Get Richer: Enriching a semi-structured dataset using a Semantic Web approach This project presented a data integration approach to enrich a semi-structured dataset called ProVerB. ProVerB is a project to explain and classify program verification tools. It offers some URLs linking to external supporting resources for each tool. However, these URLs contain little information, and a user needs to explore them manually to find what they need. Therefore, a data integration project is conducted to supply these tools with additional information by fetching original data from these URLs. The solution is implemented using a Semantic Web approach to preserve the structure of ProVerB and explore possible relationships among incoming data. The new data and their potential relationships are inserted back into ProVerB to help this dataset become richer."}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"og:updated_time","content":"2023-10-12T04:25:16.000Z"}],["meta",{"property":"article:author","content":"Yujie Liu"}],["meta",{"property":"article:tag","content":"Semantic Web"}],["meta",{"property":"article:tag","content":"Linked Data"}],["meta",{"property":"article:modified_time","content":"2023-10-12T04:25:16.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Help Rich Info Get Richer: Enriching a semi-structured dataset using a Semantic Web approach\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-10-12T04:25:16.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Yujie Liu\\",\\"url\\":\\"https://blog.yujieliu.com/intro.html\\"}]}"]]},"headers":[{"level":2,"title":"Slide","slug":"slide","link":"#slide","children":[]}],"git":{"createdTime":1695201843000,"updatedTime":1697084716000,"contributors":[{"name":"Yujie","email":"yujie.liu.public@gmail.com","commits":3}]},"readingTime":{"minutes":2.16,"words":648},"filePathRelative":"projects/help-rich-richer.md","localizedDate":"September 20, 2023","excerpt":"<h1> Help Rich Info Get Richer: Enriching a semi-structured dataset using a Semantic Web approach</h1>\\n<p>This project presented a data integration approach to enrich a semi-structured dataset called ProVerB. ProVerB is a project to explain and classify program verification tools. It offers some URLs linking to external supporting resources for each tool. However, these URLs contain little information, and a user needs to explore them manually to find what they need. Therefore, a data integration project is conducted to supply these tools with additional information by fetching original data from these URLs. The solution is implemented using a Semantic Web approach to preserve the structure of ProVerB and explore possible relationships among incoming data. The new data and their potential relationships are inserted back into ProVerB to help this dataset become richer.</p>","autoDesc":true}`);export{e as data};
